import logo from './logo.svg'
import React from 'react';
import './App.css';


class Calculator extends React.Component {
  render() {
    return (
      <div className="calculator">
        <Display />
        <Numpad />
      </div>
    );
  }
}

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Calculator />
      </div>
    );
  }
}

export default App;
